import { Card } from "antd";
import {
  RetweetOutlined,
  HeartOutlined,
  MessageOutlined,
  EllipsisOutlined,
} from "@ant-design";

const PostCard = ({ post }) => {
  return (
    <>
      <div>
        <Card
          cover={post.Image[0] && <PostImages images={post.Images} />}
          actions={[
            // jsx에서 배열을 작성할 때는 key를 항상 작성
            <RetweetOutlined></RetweetOutlined>,
            <HeartOutlined></HeartOutlined>,
            <MessageOutlined></MessageOutlined>,
            <Popover>
              <EllipsisOutlined></EllipsisOutlined>
            </Popover>,
          ]}
        ></Card>
      </div>
    </>
  );
};

export default PostCard;
